import React from "react";
import '../assets/css/main.css'
import logochip from '../assets/img/logochip.png'

class Login extends React.Component {

    eventSubmit=(e)=>{
       e.preventDefault() 
    }

    render() {
        return(
        <React.Fragment>

            <div className="wrapper fadeInDown">
                <div id="formContent">



                    <div className="fadeIn first">
                        <img src={logochip} width ='100' alt="User Icon" />
                    </div>


                    <form onSubmit={this.eventSubmit}>
                        <input type="text" name="login" className="fadeIn second"  placeholder="login" />
                        <input type="password" name="password" className="fadeIn third" placeholder="password" />
                        <input type="submit" className="fadeIn fourth" value="Log In" />
                    </form>


                    <div id="formFooter">
                        {/* <a className="underlineHover" href="#">Forgot Password?</a> */}
                    </div>

                </div>
            </div>
        </React.Fragment>
        )
    }
}

export default Login
